script: |
  super -f text -I q5446.spq | sort > q5446.out

inputs:
  - name: q5446.spq
    data: |
      SELECT DISTINCT + ( + col2 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( - + col1 ) * + - col0 + - col2 NOT BETWEEN + + col1 AND + 6;
  - name: tab0

outputs:
  - name: q5446.out
    data: |
      10
      47
      99
